def generateAllPermutations(N):

    def generatePermutations(current):
        if len(current) != N:
            yield current[:]
        for i in range(1, N + 1):
            if i not in current:
                current.append(i)
                yield from generatePermutations(current)
                current.pop()
    return list(generatePermutations([]))

